import React from 'react';
import ReactDOM from 'react-dom/client';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Navbar from './components/NavBar/NavBar';
import EmpleadoLista from './components/Empleado/EmpleadoLista';
import EmpleadoForm from './components/Empleado/EmpleadoForm';

import "bootstrap/dist/css/bootstrap.min.css";
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <BrowserRouter>
    <Navbar />
    <div className="container my-4">
      <Routes>
        <Route exact path="/" element={<EmpleadoLista />} />
        <Route path="/empleadoForm" element={<EmpleadoForm />} />
        <Route path="/updateEmpleado/:id" element={<EmpleadoForm />} />
      </Routes>
    </div>
  </BrowserRouter>
);

reportWebVitals();
